export function viewGame(gameId) {
  console.log(gameId);

  setInterval(function () {
    fetch(`https://www.balldontlie.io/api/v1/stats?game_ids[]=127545`)
      .then((res) => res.json())
      .then(
        (result) => {
          console.log(result);
        },
        (error) => {
          console.log(error);
        }
      );
  }, 5000);
}
